;; @@
(defdist dirac
  "Dirac distribution centered on x"
  [x] []
  (sample* [this] x)
  (observe* [this value] 
            (if (= x value) 
              0.0  
              (- (/ 1.0 0.0)))))

(with-primitive-procedures [dirac]
  (defquery bayes-net-rejection [sprinkler-obs wet-grass-obs] 
    (let [is-cloudy (sample "is-cloudy" (flip 0.5))

          is-raining (cond (= is-cloudy true ) 
                           (sample "is-raining" (flip 0.8))
                           (= is-cloudy false) 
                           (sample "is-raining" (flip 0.2)))

          sprinkler  (cond (= is-cloudy true ) 
                           (sample "sprinkler" (flip 0.1))
                           (= is-cloudy false) 
                           (sample "sprinkler" (flip 0.5)))

          wet-grass  (cond (and (= sprinkler true) 
                                (= is-raining true))
                           (sample "wet-grass" (flip 0.99))
                           (and (= sprinkler false) 
                                (= is-raining false))
                           (sample "wet-grass" (flip 0.0))
                           (or  (= sprinkler true) 
                                (= is-raining true))
                           (sample "wet-grass" (flip 0.9)))]

      (observe (dirac sprinkler) sprinkler-obs)
      (observe (dirac wet-grass) wet-grass-obs)


      is-raining)))
